let time = new Date().toLocaleString();
let day = new Date().getDay();
let month = (new Date().getMonth()) + 1;
let year = new Date().getFullYear();

const Clock = () => {
    return (
        <p className="App-clock">
            The time is {time}.<br/>
            The date is {day}.<br/>
            The month is {month}.<br/>
            The year is {year}.<br/>
            {console.log(month)}
        </p>
    );
}

export default Clock;
